#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test_mapping_size() {
        let mapping = create_kps9566_mapping();
        assert_eq!(mapping.len(), 20672);
    }

    #[test]
    fn test_sample_mappings() {
        let mapping = create_kps9566_mapping();
        assert_eq!(mapping.get(&0x8141), Some(&'갃'));
        assert_eq!(mapping.get(&0x8142), Some(&'갅'));
        assert_eq!(mapping.get(&0x8143), Some(&'갆'));
        assert_eq!(mapping.get(&0x8144), Some(&'갋'));
        assert_eq!(mapping.get(&0x8145), Some(&'갌'));
    }
}